import React, { Component } from "react";

class BuyOrderBook extends Component {
	render() {
		return (
			<div>
				<p>{this.props.count}</p>
				<p>{this.props.buyOrders}</p>
			</div>
		);
	}
}
export default BuyOrderBook;
